import React from 'react';


function App() {
  return (
    <div className="App">
      <header>
        <h1>Podcast Ideas</h1>
      </header>
      <main>
        <h1>Hello</h1>
      </main>
      <footer>
        <h1>Footer</h1>
      </footer>
    </div>
  );
}

export default App;
